text:
did you know only 5 of the 150 statues in central park are women? nyc women spoke up and now new york will be adding 8-12 new female statues... it‚Äôs a small but important start. i am so excited (!!!) to be part of this bold @harpersbazaarus editorial which celebrates change.
.

this female-forward october issue (featuring a great cover story with @zoeisabellakravitz as interviewed by @reesewitherspoon) was 100% shot by women photographers and all images are unretouched (except for the ads- hopefully brands & creative directors will be inspired to make more issue appropriate, unretouched content in the future- wouldn‚Äôt that be something!).
.

i worked 18-20 hours a day rubberizing, texturizing and painting all the clothing, props, pedestals, hair for this editorial and worked with my awesome team- katy, erica & caitlin- to add makeup, paint, style & even hair/wig application the day of production.
.

it‚Äôs a little different from my typical artwork, but the project intent and vulnerable nature of the unretouched issue format is 100% in keeping with the philosophy of my art & purpose & i liked experimenting with these techniques.  i hope you enjoy this pioneering issue- i‚Äôd love to see many more publications do this (& maybe next time with full on bodypaint?!)! üíã link in bio
.
.
.
.
.
