text:
the book of judges is full of uncomfortable narratives about abused and victimized women.
//
in judges 11, a man makes an irrational vow that ends with him murdering his own daughter. in judges 16, samson‚Äôs wife is victimized as men drag her out of her home and burn her alive to supposedly ‚Äúpunish‚Äù samson for his rash behavior. and, in judges 19, the ugliest and most detailed story of them all, a woman is thrown into the streets to be raped all night by a gang of me and eventually dies of her wounds; to story becomes even more grotesque when her husband hacks apart her lifeless body and sends pieces to each of the tribes of israel.
//
ugh.
//
after reading the book of judges, it might feel like the bible doesn‚Äôt value women and their well being, or care for their justice. how are we to interpret these stories of abuse? what is their purpose? do they leave us broken, feeling utterly helpless to the long history of assault that women have faced? are there critiques and warnings that we should identify, words that should haunt us today and teach us about our own present realities? do they give us any messages of hope?
//
this month, with great humility and sensitivity,the art of taleh will study these passages and seek out hope that point to christ. we know that many of our readers have followed the #metoo movement and have even seen first hand cases of abuse and assault in the church. we know that many of our readers have been victims themselves, and as the ford/kavanaugh trial rages on right now, painful experiences and memories are resurfacing for a lot of women. for all this and more, we grieve with you. //
so, join us as we humbly walk down this path. if you haven‚Äôt subscribed to our email list, you can do so here and get each new devotion in your inbox; and please share with your friends! http://www.theartoftaleh.com/subscribe-by-email/
//
#godloveswomen #justiceforwomen #bookofjudges #theartoftaleh #jephthahsdaughter #samsonswife #levitesconcubine #messagesoflove

